(window.webpackJsonp=window.webpackJsonp||[]).push([[1413],{1768:function(n,h,t){"use strict";t.r(h);var g=t(44),i=Object(g.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-2243-đia-tang-linh-dich-【-hai-hop-mot-】"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-2243-đia-tang-linh-dich-【-hai-hop-mot-】"}},[n._v("#")]),n._v(" Chương 2243: Địa Tạng linh dịch 【 hai hợp một 】")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("“Nơi này đồ tốt quả nhiên rất nhiều...”"),t("br"),t("br"),n._v("Mang theo Lạc Thất Thất một đường tiến lên, mới bay hai canh giờ không đến, sưu tập đến bảo vật, cũng nhanh đuổi tới Thần giới hơn một tháng kiếm được tổng cộng."),t("br"),t("br"),n._v("Mỹ Dung đan, Phá Chướng đan không ngừng bán ra, một tháng qua của cải của hắn, đã đạt đến mức độ kinh người, hai canh giờ liền đuổi tới... Đủ thấy bảo vật nhiều."),t("br"),t("br"),n._v("Bất quá, cũng là hắn linh hồn đủ cường đại, hơi chuyển động ý nghĩ một chút, có thể “Nhìn” đến càng xa, tìm kiếm phạm vi cũng càng rộng rãi, đổi lại mặt khác phong hào Thần Vương đỉnh phong, đều chỉ sợ liền một phần mười hiệu quả, đều không làm được."),t("br"),t("br"),n._v("Trống vắng không trung, vô số đá vụn bay, không ít đều sinh trưởng dược liệu quý giá, mỗi một gốc, đều có giá trị không nhỏ, trong đó còn có đủ loại khoáng thạch, huyền thiết..."),t("br"),t("br"),n._v("Những vật phẩm này tích tụ cùng một chỗ, Thần Vương cấp bậc đan dược cùng trường kiếm, đều có thể luyện chế."),t("br"),t("br"),n._v("“Những vật này, đối ta tác dụng vẫn như cũ không lớn...”"),t("br"),t("br"),n._v("Sưu tập một hồi, Trương Huyền lắc đầu."),t("br"),t("br"),n._v("Những dược liệu này là rất trân quý, nhưng đối với hắn tới nói, tuyệt phẩm Thần Nguyên đan đều không có nhiều tác dụng lớn chỗ, trừ phi có thể được đến vượt qua thứ này đồ vật, nếu không, đối thực lực tăng thêm không có cái gì ý nghĩa."),t("br"),t("br"),n._v("“Phía trước là mảnh lục địa...”"),t("br"),t("br"),n._v("Lại phi hành một hồi, Lạc Thất Thất nói."),t("br"),t("br"),n._v("Trương Huyền nhìn lại, quả nhiên thấy một mảng lớn lục địa xuất hiện ở trước mắt."),t("br"),t("br"),n._v("Đường kính mấy vạn cây số, một cái không nhìn thấy cuối cùng."),t("br"),t("br"),n._v("Linh khí đầy đủ, thảm thực vật rậm rạp."),t("br"),t("br"),n._v("“Có thể là Thần giới không trung rách nát, lục địa cũng bị cuốn vào...” Cảm giác được mặt đất có chút cảm giác quen thuộc, Trương Huyền phỏng đoán."),t("br"),t("br"),n._v("Thần giới cái nào lỗ thủng thực sự quá lớn, linh khí mới có thể nhanh như vậy suy yếu."),t("br"),t("br"),n._v("Mặt đất bị cuốn đi vào một khối, cũng không kỳ lạ."),t("br"),t("br"),n._v("Rơi trên mặt đất, tinh thần lan ra, quả nhiên cảm thấy mảnh đất này trên mặt, các loại bảo vật nhiều vô số kể, Thần giới thưa thớt khoáng thạch, tại đây chỗ nào cũng có, dòng sông đều là linh khí hội tụ mà thành."),t("br"),t("br"),n._v("“Bên kia có người...”"),t("br"),t("br"),n._v("Lông mày giương lên."),t("br"),t("br"),n._v("Bọn họ phát hiện lục địa, mặt khác tới Thần Vương, phong hào Thần Vương, cũng phát hiện, đồng dạng có người rơi vào phía trên, đại khái hơn mười, đang hội tụ vào một chỗ, tựa hồ tại thương nghị cái gì."),t("br"),t("br"),n._v("“Hai vị bằng hữu, sao không tới nói chút?”"),t("br"),t("br"),n._v("Thanh âm của đối phương vang lên, hiển nhiên, bọn họ phát hiện đối phương, đối phương cũng phát hiện bọn họ."),t("br"),t("br"),n._v("“Trương sư...” Lạc Thất Thất nhìn tới."),t("br"),t("br"),n._v("“Đi qua đi!” Trương Huyền gật gật đầu,"),t("br"),t("br"),n._v("Tất cả mọi người đến tìm kiếm bảo vật, không có gì có thể né tránh."),t("br"),t("br"),n._v("Đối phương hết thảy mười hai người, mười một cái Thần Vương, mạnh nhất một vị là Vân Ly thiên phong hào Thần Vương, mang theo Vân Ly thiên đánh dấu."),t("br"),t("br"),n._v("“Hai vị, tại hạ là Vân Ly Đại Đế dưới trướng, Ngao Phong phong hào Thần Vương!” Phong hào Thần Vương Ngao Phong ôm quyền."),t("br"),t("br"),n._v("Trương Huyền đáp lễ lại."),t("br"),t("br"),n._v("“Tất cả mọi người là vì cầu tài mà đến, một người lực lượng nhỏ, gặp được nguy hiểm, khó mà ứng đối, liên hợp cùng một chỗ cũng không cần có này lo lắng!” Ngao Phong nói."),t("br"),t("br"),n._v("Đám người gật đầu."),t("br"),t("br"),n._v("Đơn độc Thần Vương ở đây lời nói, quả thực rất nguy hiểm, không nói mặt khác, các loại thời không khe hở, cạm bẫy, cũng làm người ta không cách nào đề phòng, hơi không cẩn thận liền vô cùng có khả năng thân tử đạo vẫn."),t("br"),t("br"),n._v("Huống chi, còn có chuyên môn Thần Vương, phong hào Thần Vương canh giữ ở chỗ tối tiến hành đi săn, không có liên hợp cùng một chỗ, cho dù đạt được bảo vật, có thể hay không cầm trở về, cũng không tốt nói."),t("br"),t("br"),n._v("Mỗi một lần linh khí thuỷ triều, chết ở trong đó Thần Vương, phong hào, không biết bao nhiêu, thậm chí vượt qua một nửa."),t("br"),t("br"),n._v("“Chư vị đều biết, Thần Vương cường giả, không chiếm được Đế Quân tán thưởng, không thông qua phong hào khảo hạch, coi như tu luyện lại lâu, cũng chỉ có thể tại cùng một cái cảnh giới quanh quẩn một chỗ, lại không cách nào tiến bộ nửa phần! Tuổi thọ cũng chỉ có một vạn năm khoảng chừng, thời gian vừa đến, biến thành tro bụi...”"),t("br"),t("br"),n._v("Ngao Phong nói."),t("br"),t("br"),n._v("Dưới thân mười một vị Thần Vương đều mặt có buồn bã, cảm động lây."),t("br"),t("br"),n._v("Phong hào Thần Vương thực lực, cũng không phải là dần dần từng bước tu luyện, có thể đi đến... Nguyên nhân chính là như vậy, mới để cho vô số Thần Vương vì đó đố kị."),t("br"),t("br"),n._v("“Thuỷ triều biển nơi này bảo vật, mọi người chắc hẳn cũng nhận được không ít, đủ có thể khiến các ngươi đem tu vi đẩy tới Thần Vương đỉnh phong, có thể... Đạt đến đỉnh phong lại như thế nào? Tuổi thọ cũng sẽ không tăng thêm?”"),t("br"),t("br"),n._v("Ngao Phong nhìn quanh một tuần, thanh âm bên trong mang theo cám dỗ: “Trừ phi... Các ngươi có thể được đến Đế Quân tán thưởng!”"),t("br"),t("br"),n._v("“Chúng ta cũng biết, đạt được Đế Quân tán thưởng, được hắn chỉ điểm một hai, liền có thể thông qua khảo hạch, thậm chí trở thành phong Vương, có thể... Làm sao đạt được Đế Quân tán thưởng?”"),t("br"),t("br"),n._v("Một vị Thần Vương nhịn không được nói."),t("br"),t("br"),n._v("Ai không muốn để Đế Quân ưa thích?"),t("br"),t("br"),n._v("Có thể Đế Quân cao cao tại thượng, gặp đều không thấy được, muốn cho hắn tán thưởng, sao mà khó khăn!"),t("br"),t("br"),n._v("Đã từng có một vị Thần Vương, muốn đạt được tán thưởng, cố ý đi hành động kinh người, lấy thu hút con mắt, kết quả, lấy được không phải thưởng thức, mà là một bàn tay đập chết..."),t("br"),t("br"),n._v("Từ đó sau đó, tất cả tu luyện giả đều hiểu tới, muốn lấy được Đế Quân công nhận, nhất định phải có đầy đủ thực lực, còn muốn có người giới thiệu, nếu không... Tất cả đều là hư ảo."),t("br"),t("br"),n._v("“Nói đến phức tạp, trên thực tế cũng đơn giản!” Thấy mọi người bị thu hút, Ngao Phong cười cười, nói: “Thực ra, lần này ta đi vào nơi này, là mang theo Đế Quân dặn dò! Lão nhân gia ông ta, muốn đạt được một cái bảo vật, chư vị nếu như có thể giúp ta được đến, dâng ra đi, khẳng định sẽ để cho hắn long nhan cực kỳ vui mừng, đến lúc đó, thân truyền đệ tử, phong hào Thần Vương loại hình, dễ như trở bàn tay!”"),t("br"),t("br"),n._v("“Đế Quân cần bảo vật?”"),t("br"),t("br"),n._v("“Đế Quân không phải vô dục vô cầu ư? Cũng có nhu cầu đồ vật?”"),t("br"),t("br"),n._v("“Ngươi nói là sự thật, thật chỉ cần tìm được loại bảo vật này, Đế Quân liền sẽ thu làm thân truyền, thậm chí trực tiếp phong Vương?”"),t("br"),t("br"),n._v("Đám người sững sờ, tất cả đều có chút động lòng."),t("br"),t("br"),n._v("Liền sợ Đế Quân vô dục vô cầu."),t("br"),t("br"),n._v("Chỉ cần có ngọc vọng, liền dễ làm."),t("br"),t("br"),n._v("Thật muốn có thể làm được, đạt được phong hào, thật là có khả năng."),t("br"),t("br"),n._v("“Không biết Đế Quân muốn bảo vật là cái gì?” Kìm nén không được, có người hỏi."),t("br"),t("br"),n._v("Nếu như quá hiếm có đến, thậm chí sẽ vì thế đánh đổi mạng sống, quên đi."),t("br"),t("br"),n._v("Muốn lấy được phong hào, là vì kéo dài tuổi thọ, đạt được cao hơn địa vị, nếu là bởi vậy mất đi sinh mệnh, liền bỏ gốc lấy ngọn."),t("br"),t("br"),n._v("“Đế Quân muốn đồ vật, ngay tại trên phiến đại lục này, là một phần , thứ này linh khí quá mức nồng đậm, ta loại thực lực này, đều dùng không dùng đến, chỉ có Đế Quân mới có thể luyện hóa...”"),t("br"),t("br"),n._v("Ngao Phong ánh mắt lóe lên: “Có điều, nơi này có một ít huyễn linh bảo vệ, ta một người không cách nào đi vào, cần chư vị trợ giúp, mới có thể thu được lấy!”"),t("br"),t("br"),n._v("“Huyễn linh?”"),t("br"),t("br"),n._v("“Là linh khí quá đầy đủ, mà ra đời một loại sinh mệnh đặc thù, không có thực thể, thực lực cùng Thần Vương tương đương, rất là khó chơi! Ta vừa mới đi qua một lần, bị ngăn cản bên ngoài, mọi người liên thủ, hẳn là có thể phá vỡ phòng ngự!”"),t("br"),t("br"),n._v("Ngao Phong nói."),t("br"),t("br"),n._v("Nếu như cái này Địa Tạng linh dịch, một mình hắn có thể cầm tới, chắc chắn sẽ không tìm những người khác chia sẻ."),t("br"),t("br"),n._v("Đáng tiếc, cho dù thân là phong hào, ở đây, cũng không có biện pháp quá tốt."),t("br"),t("br"),n._v("“Địa Tạng linh dịch?” Trương Huyền mắt sáng rực lên."),t("br"),t("br"),n._v("Thứ này trước hắn tại Khổng sư chỗ ở trong thư tịch nhìn qua ghi chép, hiệu quả vượt xa tuyệt phẩm Thần Nguyên đan, nếu như có thể lấy được lời nói, có lẽ có thể một lần xung kích phong hào Thần Vương đỉnh phong."),t("br"),t("br"),n._v("“Huyễn linh số lượng nhiều không nhiều? Nếu như quá mức nguy hiểm, quên đi, chúng ta chỉ muốn an toàn đi qua còn lại thời gian...”"),t("br"),t("br"),n._v("Trong đám người một vị Thần Vương nói."),t("br"),t("br"),n._v("“An toàn đi qua còn lại thời gian? Ha ha, ngươi cảm thấy Thần giới hiện tại tình cảnh, loại này thời gian còn có thể duy trì bao nhiêu năm? Linh khí biến mất, tài nguyên thiếu thốn! Đừng nói tấn cấp càng cao, coi như duy trì hiện tại trạng thái, đối chư vị tới nói, cũng cần tiêu phí không ít đánh đổi đi! Mà các ngươi tích góp... Lại có thể duy trì bao lâu?”"),t("br"),t("br"),n._v("Dường như sớm biết có người có thể như vậy nói, Ngao Phong hừ lạnh: “Một khi duy trì không được, tu vi hạ xuống, cừu nhân của các ngươi, kiêng kị ngươi vị trí cùng thực lực người, sẽ làm thế nào? Các ngươi sau lưng bảo vệ thế lực, lại sẽ làm sao? Không cần ta nói nhiều, hẳn là cũng có thể muốn lấy được đi!”"),t("br"),t("br"),n._v("“Cái này...”"),t("br"),n._v("Đám người không cách nào phản bác."),t("br"),t("br"),n._v("Tu luyện, như đi ngược dòng nước, không tiến ắt lùi."),t("br"),t("br"),n._v("Muốn một mực duy trì, cũng cần vô số tài nguyên tích tụ, liền giống như vận động viên vì duy trì đỉnh phong trình độ, nhất định phải không ngừng rèn luyện, các loại dinh dưỡng phối hợp, không dám có chút qua loa đồng dạng."),t("br"),t("br"),n._v("Hiện tại toàn bộ Thần giới linh khí suy yếu, tài nguyên thiếu thốn, cho dù là Thần Vương, muốn duy trì cũng càng ngày càng khó, huống chi, mỗi cái sau lưng đều dính dáng một dòng họ khổng lồ, một khi xảy ra chuyện, trước đó tích lũy tất cả, đều sẽ tan rã, tan thành mây khói."),t("br"),t("br"),n._v("“Lúc này Thần giới, đã không cho phép an toàn sống qua ngày, hoặc là tiến một bước, hoặc là chết... Chỉ đơn giản như vậy! Cho dù phong hào Thần Vương, cũng không thể miễn trừ!”"),t("br"),t("br"),n._v("Thấy mọi người không nói lời nào, Ngao Phong tiếp tục nói: “Nói thật cho các ngươi biết, hai ngày trước, trên mặt trăng, bộc phát chiến đấu, Thiên Túng Đại Đế... Đã vẫn lạc!”"),t("br"),t("br"),n._v("“Ngươi nói cái gì?”"),t("br"),t("br"),n._v("“Thiên Túng Đại Đế vẫn lạc?”"),t("br"),t("br"),n._v("“Làm sao vẫn lạc? Chẳng lẽ là... Linh Tê Đế Tôn tỷ thí?”"),t("br"),t("br"),n._v("“Đế Quân cũng sẽ vẫn lạc?”"),t("br"),t("br"),n._v("Đám người trong nháy mắt nổ tung."),t("br"),t("br"),n._v("Khổng sư cùng Lạc Nhược Hi chiến đấu, tại trên mặt trăng, Thần giới loại trừ Đế Quân cùng Đế Quân thân mật phong hào biết, hầu như không có người biết, giờ phút này nghe được tin tức này, tất cả đều khó tin."),t("br"),t("br"),n._v("Thiên Túng Đại Đế, đột nhiên xuất hiện, cho vô số phổ thông tu luyện giả hi vọng, cảm thấy chỉ cần cố gắng, đồng dạng có thể trở thành Đế Quân... Khiêu chiến thiên địa một hình thành liền xuất hiện rất nhiều Đế Quân!"),t("br"),t("br"),n._v("Nguyên nhân chính là như vậy, hắn là vô số Thần Linh thần tượng, dù là không nói, cũng từng cái tôn sùng không ngớt."),t("br"),t("br"),n._v("Vốn cho rằng, vị này thần tượng, cho dù khiêu chiến Linh Tê Đế Tôn, cũng sẽ nhẹ nhõm chiến thắng, nằm mơ đều không có nghĩ đến... Vậy mà vẫn lạc!"),t("br"),t("br"),n._v("Đế Quân đều có thể vẫn lạc, bọn họ chỉ là phổ thông Thần Vương... Vẫn lạc khả năng càng lớn hơn."),t("br"),t("br"),n._v("Mười một vị Thần Vương, đều nói không ra lời nói đến, bầu không khí có chút đè nén."),t("br"),t("br"),n._v("“Cho nên, chúng ta cần trở nên mạnh hơn, như vậy mới có thể bảo vệ bản thân, bảo vệ người nhà, mà không phải giống như trước đây, an toàn hiện trạng!”"),t("br"),t("br"),n._v("Thấy mọi người đã bị thuyết phục, Ngao Phong nói: “Huyễn linh là có nhất định nguy hiểm, nhưng chúng ta chỉ cần liên hợp cùng một chỗ, thật tốt phối hợp, đạt được bảo vật khả năng, sẽ đi đến chín thành! Chín thành hi vọng, thay đổi nhân sinh, nên lựa chọn như thế nào, không cần ta nói nhiều, chư vị cũng rõ ràng đi!”"),t("br"),t("br"),n._v("“Chúng ta cần suy nghĩ...”"),t("br"),t("br"),n._v("“Như vậy đi!” Thấy bọn họ còn có chút chần chừ, Ngao Phong nói tiếp: “Mọi người chỉ cần nguyện ý cùng ta cùng nhau, mặc kệ có thể hay không đạt được Địa Tạng linh dịch, ta đều sẽ lấy một viên tuyệt phẩm Thần Nguyên đan cộng thêm một món nợ ân tình của ta, vì tạ ơn! Đương nhiên, được ân tình của ta, đạt được bảo vật về sau, Đế Quân ban thưởng cũng đừng hòng.”"),t("br"),t("br"),n._v("“Cái này...”"),t("br"),t("br"),n._v("Đầu tiên là sững sờ, ngay sau đó đám người con mắt sáng lên, từng cái tràn đầy hừng hực."),t("br"),t("br"),n._v("Cái này mười một vị Thần Vương, phần lớn đều là tán tu, mặc dù có chút là mặt khác trời, không có gia tộc chống đỡ, có thể có được tài nguyên cũng không nhiều."),t("br"),t("br"),n._v("Tuyệt phẩm Thần Nguyên đan, dù là chỉ có một viên, đối bọn hắn tới nói, đã coi như là giá trên trời."),t("br"),t("br"),n._v("Huống chi, còn có phong hào Thần Vương nhân tình..."),t("br"),t("br"),n._v("Loại nhân tình này giá cả, tuyệt đối vượt xa quá một viên đan dược."),t("br"),t("br"),n._v("Huống chi... Còn có cơ hội, đạt được Đế Quân cường giả hảo cảm!"),t("br"),t("br"),n._v("Tính thế nào, đều không lỗ bản."),t("br"),t("br"),n._v("“Tốt, ta đáp ứng!”"),t("br"),t("br"),n._v("“Ta cũng đáp ứng!”"),t("br"),t("br"),n._v("..."),t("br"),t("br"),n._v("Kỳ ngộ cùng nguy hiểm cùng tồn tại."),t("br"),t("br"),n._v("Có thể mạo hiểm đi vào nơi này, khẳng định đã sớm báo tử vong định, lại thêm có thể đi đến Thần Vương cấp bậc, cơ bản không có hạng người ham sống sợ chết, ngắn ngủi một phút đồng hồ, mười một vị Thần Vương liền làm ra quyết định."),t("br"),t("br"),n._v("“Hai vị, các ngươi đây?”"),t("br"),t("br"),n._v("Thấy mọi người đồng ý, Ngao Phong thở phào nhẹ nhõm, nhìn về phía Trương Huyền hai người."),t("br"),t("br"),n._v("“Ta cũng đồng ý...”"),t("br"),t("br"),n._v("Trương Huyền gật đầu."),t("br"),t("br"),n._v("Nếu Địa Tạng linh dịch đối với hắn có ích, tìm được trước lại nói."),t("br"),t("br"),n._v("“Vậy thì tốt, chúng ta hiện tại liền trở thành liên minh, nếu có người tạm thời thoát ly, nhất định phải nhận phán quyết! Thậm chí... Có thể làm tràng đánh giết!” Ngao Phong nói."),t("br"),t("br"),n._v("Liên hợp cùng một chỗ, kiêng kỵ nhất có người lâm trận bỏ chạy, đến lúc đó, vô cùng có khả năng cho tất cả mọi người mang đến nguy hiểm."),t("br"),t("br"),n._v("“Tốt!” Đám người rõ ràng những này, đồng thời gật đầu."),t("br"),t("br"),n._v("“Đi thôi!”"),t("br"),t("br"),n._v("Thảo luận xong, Ngao Phong không nói thêm lời, dẫn đầu bay tới đằng trước, đám người theo sát phía sau."),t("br"),t("br"),n._v("Không lâu sau, đi tới một chỗ khe núi, nơi này linh khí càng thêm nồng đậm, các loại thảm thực vật rậm rạp che khuất bầu trời."),t("br"),t("br"),n._v("“Trước mặt chính là huyễn linh...”"),t("br"),t("br"),n._v("Ngao Phong một chỉ."),t("br"),t("br"),n._v("Đám người nhìn lại, ngay sau đó nhìn thấy phía trước sương mù trắng xóa bên trong, một ít cái bóng hư ảo không ngừng lay động."),t("br"),t("br"),n._v("“Là mạnh mẽ linh khí dựng dục... Thảo mộc chi linh!”"),t("br"),t("br"),n._v("Trương Huyền giật mình."),t("br"),t("br"),n._v("Còn tưởng rằng cái gọi là huyễn linh là cái gì, nguyên lai là nơi này linh khí quá đầy đủ, một ít cổ thụ, cổ thảo, tạo thành ý thức của mình."),t("br"),t("br"),n._v("Cùng lúc trước Đan Vương đồng dạng."),t("br"),t("br"),n._v("Những này linh tính, tuy là thoạt nhìn là Thần Vương cấp bậc thực lực, trên thực tế sức chiến đấu rất yếu, chỉ là số lượng rất lớn, làm cho không người nào có thể ngăn cản cùng phòng ngự mà thôi!"),t("br"),t("br"),n._v("Hơn nữa, chỉ cần nơi này linh khí vẫn còn, bọn chúng có thể nói bất tử bất diệt, quả thực vô cùng khó chơi."),t("br"),t("br"),n._v("“Mục đích của chúng ta là vì đạt được Địa Tạng linh dịch, mà không phải cùng bọn chúng làm liều mạng tranh đấu... Cho nên, mục đích của chúng ta là đi vào khe núi nội bộ, tìm tới đồ vật, tiếp đó cấp tốc rời đi!”"),t("br"),t("br"),n._v("Thấy mọi người rõ ràng huyễn linh là cái gì, Ngao Phong an bài sách lược ứng đối: “Một lát nữa, chư vị theo bốn phương tám hướng công kích, đem những này huyễn linh tẫn khả năng hấp dẫn ra đi, tiếp đó ta tìm cơ hội lẫn vào trong đó, một cầm tới linh dịch, chúng ta liền lập tức rời đi...”"),t("br"),t("br"),n._v("“Phương pháp là tốt, nhưng nếu như ngươi cầm tới linh dịch về sau, trực tiếp trốn, không nói cho chúng ta, chúng ta được hắn bọn họ vây khốn nên làm cái gì?”"),t("br"),t("br"),n._v("Một vị Thần Vương nói."),t("br"),t("br"),n._v("Không phải không tin đối phương, mà là mới vừa quen, ai cũng không dám thật đem sinh tử phó thác những người khác."),t("br"),t("br"),n._v("“Không sai, ngươi cầm tới đồ vật đi, chúng ta bị nhốt trong đó, chỗ tốt gì đều không có không nói, còn có thể vẫn lạc, chuyện này không thể như vậy!”"),t("br"),t("br"),n._v("Lại có Thần Vương nói."),t("br"),t("br"),n._v("“Vậy các ngươi nói làm sao bây giờ?”"),t("br"),t("br"),n._v("Gặp tất cả mọi người một mặt chất vấn hình dáng, Ngao Phong nhíu nhíu mày."),t("br"),t("br"),n._v("“Muốn vào cùng một chỗ tiến, muốn lui cùng một chỗ lui!” Lời mới vừa nói Thần Vương nói."),t("br"),t("br"),n._v("“Không sai, cùng một chỗ tiến, cùng một chỗ lui!” Đám người đồng thời gật đầu."),t("br"),t("br"),n._v("“Cùng một chỗ tiến lui, là rất an toàn, nhưng các ngươi có hay không nghĩ tới, một khi bị những này huyễn linh vây lên, chúng ta đừng nói lấy không được bảo vật, vô cùng có khả năng đều chết ở bên trong!”"),t("br"),t("br"),n._v("Ngao Phong nói."),t("br"),t("br"),n._v("(Muốn đi Thành Đô huấn luyện, đi máy bay, đi đường, hai chương liền không xa rời nhau, trực tiếp hai hợp một.)"),t("br"),t("br"),n._v("Người đăng: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-2257"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-2259"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=i.exports}}]);